import { jsPDF } from "jspdf";
var font =
  "";
var callAddFont = function() {
  this.addFileToVFS("GFSNeohellenic-Regular-normal.ttf", font);
  this.addFont(
    "GFSNeohellenic-Regular-normal.ttf",
    "GFSNeohellenic-Regular",
    "normal"
  );
};
jsPDF.API.events.push(["addFonts", callAddFont]);
